        google.protobuf.UInt64Value rbodymod = 29; // Distributed body R model selector
        google.protobuf.UInt64Value rgatemod = 30; // Gate resistance model selector
        google.protobuf.UInt64Value geomod = 31; // Geometry dependent parasitics model selector

